INSERT INTO `consumer_backend_chat` VALUES (1,'If you can share you location, we can push more relevant content and information in and around your city',4),(2,'Fantastic! We would love to know more about your process and connect with you. Do you mind sharing your name and email so that we can feature you as a neighbourhood champion',8),(3,'Organic waste - All your food waste, kitchen scraps and leftovers from meals, as well as waste from your garden, constitutes organic waste.',10),(4,'Recyclables - Recyclable waste is all paper, plastic, glass and metal. These can be recycled into new raw material instead of using virgin materials',11),(5,'Segregation is storing your waste separately, based on what category it belongs to. The most basic system to follow is a 3 bin system for organic waste, recyclable waste and hazardous, sanitary and reject waste.',9),(6,'Hazardous, sanitary, rejects - Hazardous waste is leftover chemicals, toner cartridges, sharp objects',12),(7,'That is it for today. Do you want to enable notifications so that we can share more interesting snippets ike this with you?',12),(8,'Organic waste - Your unpalatable kitchen garbage can be converted into nutrient rich, organic manure. This is called composting.',14),(9,'Recyclable waste - Your recycled waste can be sold to your nearest scrap dealer or Kabadiwalla. He is a very important part of the waste management ecosystem because he ensures that your waste goes back to recyclers, and not into landfills.',15),(10,'Show an interesting article?',16);
